import React, { useState } from 'react';

const VendorPage = () => {
  const [formData, setFormData] = useState({
    contactName: '',
    businessName: '',
    email: '',
    phoneNumber: '',
    website: '',
    productsServices: '',
    itemsList: '',
    electricityRequired: false,
    staffCount: 0,
    hasDigitalPayment: false,
    acceptedTerms: false,
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission, e.g., send data to server
    console.log(formData);
  };

  return (
    <div className="flex flex-col md:flex-row justify-center items-start gap-8">
      {/* Long description column */}
      <div className="w-full md:w-1/2">
        <h1 className="text-3xl font-bold mb-4">Registration Details</h1>
        <p className="text-lg text-gray-700 leading-relaxed">
          Please fill out the following form with your registration details to
          participate in the event. Make sure to provide accurate information
          for smooth processing and approval.
        </p>
      </div>
      {/* Registration form column */}
      <div className="w-full md:w-1/2 bg-white p-6 rounded-lg shadow-lg">
        <h1 className="text-2xl font-bold mb-4">Registration Form</h1>
        <form onSubmit={handleSubmit}>
          {/* Input fields */}
          {/* ... */}
          <div className="mb-4">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Contact Name
            </label>
            <input
              type="text"
              name="contactName"
              value={formData.contactName}
              onChange={handleChange}
              className="w-full border-gray-300 border rounded-md py-2 px-3 focus:outline-none focus:border-blue-500"
            />
          </div>
          {/* Other input fields go here */}
          <div className="mb-4">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              I have read and accepted the terms and conditions
            </label>
            <input
              type="checkbox"
              name="acceptedTerms"
              checked={formData.acceptedTerms}
              onChange={handleChange}
              className="mr-2 leading-tight"
            />
            <span className="text-sm text-gray-700">
              I have read and accept the terms and conditions
            </span>
          </div>
          {/* Submit button */}
          <button
            type="submit"
            className="bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-600"
          >
            Register
          </button>
        </form>
      </div>
    </div>
  );
};

export default VendorPage;
